import {StyleSheet} from 'react-native';

const styles=StyleSheet.create({
    container:{
        width:'100%',
        padding:10
    },
    button:{
        alignItems:'center',
        justifyContent:'center',
        height:40,
        borderRadius:20
    },
    buttonText:{
        fontSize:18,
        fontWeight:'500',
        textTransform:'uppercase'
    }


});

export default styles;
